import React from 'react';
import {Link} from 'react-router-dom'

import { Icon } from 'react-icons-kit';
import { arrows_slim_right } from 'react-icons-kit/linea/arrows_slim_right';



function Contacts() {
  return (
    <div className="contacts">
      <div className="contacts-left">
        <h1>Get in touch:</h1>
        <span>myriankatto@gmail.com</span>
        <span>+55 11 998025678</span>
        <span>Myrian Katto @ 2020</span>
      </div>
      <div className="contacts-righ">
        <h2>Let's have a coffee?</h2>
        <Link to="/" target="_blank">
            <div className="contact-btn">
              <span>Schedule here</span>
              <Icon icon={arrows_slim_right} size={35} />
            </div>
          </Link>
      </div>
    </div>
  );
}

export default Contacts;
